    virtual ~TPMS_CLOCK_INFO();
    /// <summary>
    /// This structure is used in each of the attestation commands.
    /// </summary>
    ///<param name = "clock">time in milliseconds during which the TPM has been powered This structure element is used to report on the TPM's Clock value. The value of Clock shall be recorded in non-volatile memory no less often than once per 222 milliseconds (~69.9 minutes) of TPM operation. The reference for the millisecond timer is the TPM oscillator. This value is reset to zero when the Storage Primary Seed is changed (TPM2_Clear()). This value may be advanced by TPM2_AdvanceClock().</param>
    ///<param name = "resetCount">number of occurrences of TPM Reset since the last TPM2_Clear()</param>
